import React from "react";
import { Container } from "react-bootstrap";
import styles from "./RegisterPage.module.css";

const RegisterPage = () => {
  return (
    <Container fluid className={styles.container}>
      <h1>RegisterPage</h1>
    </Container>
  );
};

export default RegisterPage;
